import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';
import DataTable from '../components/DataTable';
import UserProfileDropdown from '../components/UserProfileDropdown';

const SuperAdminDashboard = () => {
  const { user, logout } = useAuth();
  const [activeTab, setActiveTab] = useState('overview');
  const [farmers, setFarmers] = useState([]);
  const [employees, setEmployees] = useState([]);
  const [registrations, setRegistrations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [filters, setFilters] = useState({
    status: '',
    role: '',
    designation: '',
    state: '',
    district: ''
  });
  const [registrationFilters, setRegistrationFilters] = useState({
    status: '',
    role: '',
    state: '',
    district: ''
  });
  const [employeeFilters, setEmployeeFilters] = useState({
    status: '',
    role: '',
    designation: '',
    state: '',
    district: ''
  });

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');

      // Force use of mock data
      const mockFarmers = [
        { id: 1, name: 'John Doe', phone: '+91 9876543210', state: 'Kerala', district: 'Ernakulam', kycStatus: 'Approved', role: 'Farmer' },
        { id: 2, name: 'Jane Smith', phone: '+91 9876543211', state: 'Tamil Nadu', district: 'Chennai', kycStatus: 'Pending', role: 'Farmer' },
        { id: 3, name: 'Bob Johnson', phone: '+91 9876543212', state: 'Karnataka', district: 'Bangalore', kycStatus: 'Rejected', role: 'Farmer' }
      ];

      const mockEmployees = [
        { id: 1, name: 'Admin User', email: 'admin@example.com', phone: '+91 9876543213', designation: 'Manager', state: 'Kerala', status: 'Active', role: 'Admin' },
        { id: 2, name: 'Employee User', email: 'employee@example.com', phone: '+91 9876543214', designation: 'Coordinator', state: 'Tamil Nadu', status: 'Active', role: 'Employee' }
      ];

      const mockRegistrations = [
        { id: 1, name: 'New Farmer', email: 'newfarmer@example.com', phone: '+91 9876543215', role: 'Farmer', state: 'Kerala', status: 'Pending' },
        { id: 2, name: 'New Employee', email: 'newemployee@example.com', phone: '+91 9876543216', role: 'Employee', state: 'Tamil Nadu', status: 'Pending' }
      ];

      setFarmers(mockFarmers);
      setEmployees(mockEmployees);
      setRegistrations(mockRegistrations);
    } catch (error) {
      console.error('Error fetching data:', error);
      setError('Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  const getStats = () => {
    const totalFarmers = farmers.length;
    const totalEmployees = employees.length;
    const totalFPO = 0; // Placeholder for FPO count

    const farmersChange = '+15.2%';
    const employeesChange = '+8.7%';
    const fpoChange = '+0.0%';

    return {
      farmers: { count: totalFarmers, change: farmersChange },
      employees: { count: totalEmployees, change: employeesChange },
      fpo: { count: totalFPO, change: fpoChange }
    };
  };

  const getFilteredFarmers = () => {
    return farmers.filter(farmer => {
      const matchesStatus = !filters.status || farmer.kycStatus?.toLowerCase() === filters.status.toLowerCase();
      const matchesRole = !filters.role || farmer.role?.toLowerCase() === filters.role.toLowerCase();
      const matchesState = !filters.state || farmer.state?.toLowerCase() === filters.state.toLowerCase();
      const matchesDistrict = !filters.district || farmer.district?.toLowerCase() === filters.district.toLowerCase();

      return matchesStatus && matchesRole && matchesState && matchesDistrict;
    });
  };

  const getFilteredEmployees = () => {
    return employees.filter(employee => {
      const matchesStatus = !employeeFilters.status || employee.status?.toLowerCase() === employeeFilters.status.toLowerCase();
      const matchesRole = !employeeFilters.role || employee.role?.toLowerCase() === employeeFilters.role.toLowerCase();
      const matchesDesignation = !employeeFilters.designation || employee.designation?.toLowerCase() === employeeFilters.designation.toLowerCase();
      const matchesState = !employeeFilters.state || employee.state?.toLowerCase() === employeeFilters.state.toLowerCase();
      const matchesDistrict = !employeeFilters.district || employee.district?.toLowerCase() === employeeFilters.district.toLowerCase();

      return matchesStatus && matchesRole && matchesDesignation && matchesState && matchesDistrict;
    });
  };

  const getFilteredRegistrations = () => {
    return registrations.filter(registration => {
      const matchesStatus = !registrationFilters.status || registration.status?.toLowerCase() === registrationFilters.status.toLowerCase();
      const matchesRole = !registrationFilters.role || registration.role?.toLowerCase() === registrationFilters.role.toLowerCase();
      const matchesState = !registrationFilters.state || registration.state?.toLowerCase() === registrationFilters.state.toLowerCase();
      const matchesDistrict = !registrationFilters.district || registration.district?.toLowerCase() === registrationFilters.district.toLowerCase();

      return matchesStatus && matchesRole && matchesState && matchesDistrict;
    });
  };

  const handleApproveKYC = (farmerId) => {
    console.log('Approving KYC for farmer:', farmerId);
    // Implement KYC approval logic
  };

  const handleRejectKYC = (farmerId) => {
    console.log('Rejecting KYC for farmer:', farmerId);
    // Implement KYC rejection logic
  };

  const handleApproveRegistration = (registrationId) => {
    console.log('Approving registration:', registrationId);
    // Implement registration approval logic
  };

  const handleRejectRegistration = (registrationId) => {
    console.log('Rejecting registration:', registrationId);
    // Implement registration rejection logic
  };

  const stats = getStats();

  const renderOverview = () => (
    <>
      {/* Welcome Section */}
      <div className="welcome-section">
        <h1 className="welcome-title">Super Admin Dashboard</h1>
        <p className="welcome-subtitle">Welcome back! Here's what's happening with your agricultural platform.</p>
      </div>

      {/* Time Filters */}
      <div className="time-filters">
        <button className="time-filter-btn">
          <i className="fas fa-sync-alt"></i>
          Refresh
        </button>
        <button className="time-filter-btn active">
          <i className="fas fa-calendar-day"></i>
          Today
        </button>
        <button className="time-filter-btn">
          <i className="fas fa-calendar-week"></i>
          This Month
        </button>
        <button className="time-filter-btn">
          <i className="fas fa-calendar"></i>
          This Year
        </button>
      </div>

      {/* Stats Grid */}
      <div className="stats-grid">
        <div className="stats-card">
          <div className="stats-icon farmers">
            <i className="fas fa-users"></i>
          </div>
          <div className="stats-title">Farmers</div>
          <div className="stats-value">{stats.farmers.count}</div>
          <div className={`stats-change ${stats.farmers.change.startsWith('+') ? 'positive' : 'negative'}`}>
            <i className={`fas fa-${stats.farmers.change.startsWith('+') ? 'arrow-up' : 'arrow-down'}`}></i>
            {stats.farmers.change}
          </div>
        </div>

        <div className="stats-card">
          <div className="stats-icon employees">
            <i className="fas fa-user-tie"></i>
          </div>
          <div className="stats-title">Employees</div>
          <div className="stats-value">{stats.employees.count}</div>
          <div className={`stats-change ${stats.employees.change.startsWith('+') ? 'positive' : 'negative'}`}>
            <i className={`fas fa-${stats.employees.change.startsWith('+') ? 'arrow-up' : 'arrow-down'}`}></i>
            {stats.employees.change}
          </div>
        </div>

        <div className="stats-card">
          <div className="stats-icon fpo">
            <i className="fas fa-building"></i>
          </div>
          <div className="stats-title">FPO</div>
          <div className="stats-value">{stats.fpo.count}</div>
          <div className={`stats-change ${stats.fpo.change.startsWith('+') ? 'positive' : 'negative'}`}>
            <i className={`fas fa-${stats.fpo.change.startsWith('+') ? 'arrow-up' : 'arrow-down'}`}></i>
            {stats.fpo.change}
          </div>
        </div>
      </div>

      {/* Bottom Sections */}
      <div className="bottom-sections">
        {/* Recent Activities */}
        <div className="section-card">
          <div className="section-header">
            <h3 className="section-title">Recent Activities</h3>
            <a href="#" className="section-link">View All</a>
          </div>
          <div className="activities-list">
            <div className="activity-item">
              <div className="activity-icon success">
                <i className="fas fa-user-edit"></i>
              </div>
              <div className="activity-content">
                <div className="activity-text">Farmer profile updated</div>
                <div className="activity-time">20m ago</div>
              </div>
              <span className="activity-badge success">SUCCESS</span>
            </div>
            <div className="activity-item">
              <div className="activity-icon success">
                <i className="fas fa-user-tie"></i>
              </div>
              <div className="activity-content">
                <div className="activity-text">Employee profile updated</div>
                <div className="activity-time">10m ago</div>
              </div>
              <span className="activity-badge success">SUCCESS</span>
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="section-card">
          <div className="section-header">
            <h3 className="section-title">Quick Actions</h3>
          </div>
          <div className="quick-actions-grid">
            <button className="quick-action-btn primary">
              <i className="fas fa-users"></i>
              View Users
            </button>
            <button className="quick-action-btn secondary">
              <i className="fas fa-user-friends"></i>
              View Farmers
            </button>
          </div>
        </div>
      </div>
    </>
  );

  const renderFarmers = () => (
    <div className="section-card">
      <div className="section-header">
        <h3 className="section-title">Farmer Management</h3>
      </div>

      {/* Filters Section */}
      <div className="filters-section">
        <div className="filter-group">
          <label className="filter-label">Status</label>
          <select 
            className="filter-select"
            value={filters.status}
            onChange={(e) => setFilters({...filters, status: e.target.value})}
          >
            <option value="">All Status</option>
            <option value="approved">Approved</option>
            <option value="pending">Pending</option>
            <option value="rejected">Rejected</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">Role</label>
          <select 
            className="filter-select"
            value={filters.role}
            onChange={(e) => setFilters({...filters, role: e.target.value})}
          >
            <option value="">All Roles</option>
            <option value="farmer">Farmer</option>
            <option value="employee">Employee</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">State</label>
          <select 
            className="filter-select"
            value={filters.state}
            onChange={(e) => setFilters({...filters, state: e.target.value})}
          >
            <option value="">All States</option>
            <option value="kerala">Kerala</option>
            <option value="tamil nadu">Tamil Nadu</option>
            <option value="karnataka">Karnataka</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">District</label>
          <select 
            className="filter-select"
            value={filters.district}
            onChange={(e) => setFilters({...filters, district: e.target.value})}
          >
            <option value="">All Districts</option>
            <option value="ernakulam">Ernakulam</option>
            <option value="thrissur">Thrissur</option>
            <option value="palakkad">Palakkad</option>
          </select>
        </div>

        <div className="filter-actions">
          <button 
            className="filter-btn-clear"
            onClick={() => setFilters({status: '', role: '', designation: '', state: '', district: ''})}
          >
            <i className="fas fa-times"></i>
            Clear Filters
          </button>
        </div>
      </div>

      <DataTable
        data={getFilteredFarmers()}
        columns={[
          { key: 'name', label: 'Name' },
          { key: 'phone', label: 'Phone' },
          { key: 'state', label: 'State' },
          { key: 'district', label: 'District' },
          { 
            key: 'kycStatus', 
            label: 'KYC Status',
            render: (value) => (
              <span className={`status-badge status-${value?.toLowerCase() || 'pending'}`}>
                {value || 'Pending'}
              </span>
            )
          }
        ]}
        customActions={(item) => [
          { label: 'Approve', onClick: () => handleApproveKYC(item.id), className: 'approve' },
          { label: 'Reject', onClick: () => handleRejectKYC(item.id), className: 'reject' }
        ]}
      />
    </div>
  );

  const renderEmployees = () => (
    <div className="section-card">
      <div className="section-header">
        <h3 className="section-title">Employee Management</h3>
      </div>

      {/* Employee Filters */}
      <div className="filters-section">
        <div className="filter-group">
          <label className="filter-label">Status</label>
          <select 
            className="filter-select"
            value={employeeFilters.status}
            onChange={(e) => setEmployeeFilters({...employeeFilters, status: e.target.value})}
          >
            <option value="">All Status</option>
            <option value="active">Active</option>
            <option value="inactive">Inactive</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">Role</label>
          <select 
            className="filter-select"
            value={employeeFilters.role}
            onChange={(e) => setEmployeeFilters({...employeeFilters, role: e.target.value})}
          >
            <option value="">All Roles</option>
            <option value="admin">Admin</option>
            <option value="employee">Employee</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">Designation</label>
          <select 
            className="filter-select"
            value={employeeFilters.designation}
            onChange={(e) => setEmployeeFilters({...employeeFilters, designation: e.target.value})}
          >
            <option value="">All Designations</option>
            <option value="manager">Manager</option>
            <option value="supervisor">Supervisor</option>
            <option value="coordinator">Coordinator</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">State</label>
          <select 
            className="filter-select"
            value={employeeFilters.state}
            onChange={(e) => setEmployeeFilters({...employeeFilters, state: e.target.value})}
          >
            <option value="">All States</option>
            <option value="kerala">Kerala</option>
            <option value="tamil nadu">Tamil Nadu</option>
            <option value="karnataka">Karnataka</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">District</label>
          <select 
            className="filter-select"
            value={employeeFilters.district}
            onChange={(e) => setEmployeeFilters({...employeeFilters, district: e.target.value})}
          >
            <option value="">All Districts</option>
            <option value="ernakulam">Ernakulam</option>
            <option value="thrissur">Thrissur</option>
            <option value="palakkad">Palakkad</option>
          </select>
        </div>

        <div className="filter-actions">
          <button 
            className="filter-btn-clear"
            onClick={() => setEmployeeFilters({status: '', role: '', designation: '', state: '', district: ''})}
          >
            <i className="fas fa-times"></i>
            Clear Filters
          </button>
        </div>
      </div>

      <DataTable
        data={getFilteredEmployees()}
        columns={[
          { key: 'name', label: 'Name' },
          { key: 'email', label: 'Email' },
          { key: 'phone', label: 'Phone' },
          { key: 'designation', label: 'Designation' },
          { key: 'state', label: 'State' },
          { 
            key: 'status', 
            label: 'Status',
            render: (value) => (
              <span className={`status-badge status-${value?.toLowerCase() || 'active'}`}>
                {value || 'Active'}
              </span>
            )
          }
        ]}
      />
    </div>
  );

  const renderRegistration = () => (
    <div className="section-card">
      <div className="section-header">
        <h3 className="section-title">Registration Management</h3>
      </div>

      {/* Registration Filters */}
      <div className="filters-section">
        <div className="filter-group">
          <label className="filter-label">Status</label>
          <select 
            className="filter-select"
            value={registrationFilters.status}
            onChange={(e) => setRegistrationFilters({...registrationFilters, status: e.target.value})}
          >
            <option value="">All Status</option>
            <option value="pending">Pending</option>
            <option value="approved">Approved</option>
            <option value="rejected">Rejected</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">Role</label>
          <select 
            className="filter-select"
            value={registrationFilters.role}
            onChange={(e) => setRegistrationFilters({...registrationFilters, role: e.target.value})}
          >
            <option value="">All Roles</option>
            <option value="farmer">Farmer</option>
            <option value="employee">Employee</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">State</label>
          <select 
            className="filter-select"
            value={registrationFilters.state}
            onChange={(e) => setRegistrationFilters({...registrationFilters, state: e.target.value})}
          >
            <option value="">All States</option>
            <option value="kerala">Kerala</option>
            <option value="tamil nadu">Tamil Nadu</option>
            <option value="karnataka">Karnataka</option>
          </select>
        </div>

        <div className="filter-group">
          <label className="filter-label">District</label>
          <select 
            className="filter-select"
            value={registrationFilters.district}
            onChange={(e) => setRegistrationFilters({...registrationFilters, district: e.target.value})}
          >
            <option value="">All Districts</option>
            <option value="ernakulam">Ernakulam</option>
            <option value="thrissur">Thrissur</option>
            <option value="palakkad">Palakkad</option>
          </select>
        </div>

        <div className="filter-actions">
          <button 
            className="filter-btn-clear"
            onClick={() => setRegistrationFilters({status: '', role: '', state: '', district: ''})}
          >
            <i className="fas fa-times"></i>
            Clear Filters
          </button>
        </div>
      </div>

      <DataTable
        data={getFilteredRegistrations()}
        columns={[
          { key: 'name', label: 'Name' },
          { key: 'email', label: 'Email' },
          { key: 'phone', label: 'Phone' },
          { key: 'role', label: 'Role' },
          { key: 'state', label: 'State' },
          { 
            key: 'status', 
            label: 'Status',
            render: (value) => (
              <span className={`status-badge status-${value?.toLowerCase() || 'pending'}`}>
                {value || 'Pending'}
              </span>
            )
          }
        ]}
        customActions={(item) => [
          { label: 'Approve', onClick: () => handleApproveRegistration(item.id), className: 'approve' },
          { label: 'Reject', onClick: () => handleRejectRegistration(item.id), className: 'reject' }
        ]}
      />
    </div>
  );

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="dashboard">
      {/* Top Bar */}
      <div className="top-bar"></div>

      {/* Header */}
      <div className="dashboard-header">
        <div className="header-left">
          <div className="logo-section">
            <h1 className="logo-title">DATE</h1>
            <p className="logo-subtitle">Digital Agristack</p>
          </div>
        </div>
        <div className="header-right">
          <div className="user-info">
            <div className="user-avatar">
              {user?.name?.charAt(0) || 'U'}
            </div>
            <span className="user-email">{user?.email || 'user@example.com'}</span>
          </div>
        </div>
      </div>

      {/* Sidebar */}
      <div className="dashboard-sidebar">
        <div className="sidebar-header">
          <h2 className="sidebar-title">Super Admin Dashboard</h2>
          <p className="sidebar-subtitle">Manage your agricultural platform</p>
        </div>
        <nav className="sidebar-nav">
          <div 
            className={`nav-item ${activeTab === 'overview' ? 'active' : ''}`}
            onClick={() => setActiveTab('overview')}
          >
            <div>
              <i className="fas fa-chart-bar"></i>
              Dashboard
            </div>
            <i className="fas fa-chevron-down dropdown-arrow"></i>
          </div>
          <div 
            className={`nav-item ${activeTab === 'farmers' ? 'active' : ''}`}
            onClick={() => setActiveTab('farmers')}
          >
            <div>
              <i className="fas fa-user-friends"></i>
              Farmers
            </div>
            <i className="fas fa-chevron-down dropdown-arrow"></i>
          </div>
          <div 
            className={`nav-item ${activeTab === 'employees' ? 'active' : ''}`}
            onClick={() => setActiveTab('employees')}
          >
            <div>
              <i className="fas fa-user-tie"></i>
              Employees
            </div>
            <i className="fas fa-chevron-down dropdown-arrow"></i>
          </div>
          <div 
            className={`nav-item ${activeTab === 'registration' ? 'active' : ''}`}
            onClick={() => setActiveTab('registration')}
          >
            <div>
              <i className="fas fa-user-plus"></i>
              Registration
            </div>
            <i className="fas fa-chevron-down dropdown-arrow"></i>
          </div>
        </nav>
      </div>

      {/* Main Content */}
      <div className="dashboard-main">
        {/* User Profile Dropdown - Fixed Position */}
        <div className="user-profile-dropdown">
          <UserProfileDropdown />
        </div>

        {/* Dashboard Content */}
        <div className="dashboard-content">
          {activeTab === 'overview' && renderOverview()}
          {activeTab === 'farmers' && renderFarmers()}
          {activeTab === 'employees' && renderEmployees()}
          {activeTab === 'registration' && renderRegistration()}
        </div>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
